export default (function(a,b,c,d,e,f,g,h){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:e,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:f,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:f,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:f,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:e,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},p55iMur9wb:{data:{id:2742,attributes:{imdbId:"tt0475784",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTRmYzNmOTctZjMwOS00ODZlLWJiZGQtNDg5NDY5NjE3MTczXkEyXkFqcGdeQXVyMDM2NDM2MQ@@._V1_SX300.jpg",type:e,ratings:[{Source:"Internet Movie Database",Value:"8.6\u002F10"}],item_lang:{data:{id:3409,attributes:{title:b,plot:"This science-fiction Western series from Jonathan Nolan and Lisa Joy was inspired by Michael Crichton's Westworld (1973) and is set at a Wild West theme park created by Dr. Robert Ford (Sir Anthony Hopkins) with human-like androids, where guests are encouraged to indulge their fantasies and desires.",slug:"westworld"}}},books:{data:[{id:13046,attributes:{title:b,description:"This is the original screenplay of Westworld as it was just two days before actual shooting began. Before this, there had been many cuts, changes, additions and deletions over a period of months. Much can be learned about actual film making from reading this book. It is to be suggested to read the Forward by Former Story Editor Saul David and the introduction by Michael Chrichton at least twice, once before downloading and seeing the original film and then afterwards. Now it is said Westworld was ahead of its time in depicting the dangers of computers and automated systems. Now we can realize that when the ro I am not sure that the author Michael Chrichton even realized what he had done here. He says that his goal was merely to provide \"entertainment.\" We now understand that the robots in the movie are breaking down because of a virus or a bug in the system. The guests are paying and coming to Westworld to experience life as it was in the days of Pompeii before it was destroyed in the eruption of Mount Vesuvius in 79 AD, or the Medieval World of the 13th Century or the Wild West of the 1880s. Now we know the robots start breaking down or malfunctioning that they are being hit with a programming bug or by a computer virus. In this and many other respects this movie used new technology and did things that had never been been done before. The Medieval Queen who is a robot convinces the knight to fight a battle to the death with the Black Knight. She tells the knight he will win the battle because the Black Knight cannot see well from his left eye. It is a trap. The left eye has been repaired by the Technicians. So, the knight thinking he is sure to win is killed in real life by the Black Knight.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=z3ToAQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["Michael Chrichton"],firstBook:true,published:"2017-04-01",publisher:a,subtitle:"Where Nothing Can Go Wrong"}},{id:13047,attributes:{title:b,description:a,thumbnail:a,authors:[c],firstBook:d,published:"1972-01-01",publisher:a,subtitle:"An Original Screenplay"}},{id:13048,attributes:{title:b,description:"Drejebog til filmen Westworld",thumbnail:a,authors:[c],firstBook:d,published:"1974-01-01",publisher:a,subtitle:a}},{id:13049,attributes:{title:"Next (Enhanced Edition)",description:"Michael Crichton, the #1 New York Times bestselling author of Jurassic Park, comes an astounding, eye-opening look at the world of genetics as it’s happening now, told as only Michael Crichton can tell it, with lightening fast pacing and thrilling chases. Welcome to our genetic world. Fast, furious, and out of control. This is not the world of the future—it’s the world right now. Is a loved one missing some body parts? Are blondes becoming extinct? Is everyone at your dinner table of the same species? Humans and chimpanzees differ in only 400 genes; is that why an adult human being resembles a chimp fetus? And should that worry us? There’s a new genetic cure for drug addiction—is it worse than the disease? We live in a time of momentous scientific leaps; a time when it’s possible to sell our eggs and sperm online for thousands of dollars; test our spouses for genetic maladies and even frame someone for a genetic crime. We live in a time when one fifth of all our genes are owned by someone else, and an unsuspecting person and his family can be pursued cross-country because they happen to have certain valuable genes within their chromosomes... Devilishly clever, Next blends fact and fiction into a breathless tale of a new world where nothing is what it seems, and a set of new possibilities can open at every turn.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=4Cypt2DwO9wC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c],firstBook:d,published:"2011-07-26",publisher:h,subtitle:a}},{id:13050,attributes:{title:"Prey",description:"Michael Crichton's Prey is a terrifying page-turner that masterfully combines a heart–pounding thriller with cutting-edge technology. Deep in the Nevada desert, the Xymos Corporation has built a state-of-the-art fabrication plant, surrounded by miles and miles of nothing but cactus and coyotes. Eight people are trapped. A self-replicating swarm of predatory molecules is rapidly evolving outside the plant. Massed together, the molecules form an intelligent organism that is anything but benign. More powerful by the hour, it has targeted the eight scientists as prey. They must stop the swarm before it is too late… In Prey, Michael Crichton combines scientific brilliance with relentless pacing to create an electrifying, chilling techno-thriller",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=cLM0TnSV03kC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c],firstBook:d,published:"2009-10-13",publisher:h,subtitle:a}}]}}},meta:{}}},prerenderedAt:1681309100002}}("","Westworld","Michael Crichton",null,"series","movie",1,"Harper Collins"))